import React, { Component } from "react";

import UserService from "../services/user.service";

export default class Home extends Component {
  constructor(props) {
    super(props);

    this.state = {
      content: ""
    };
  }

  componentDidMount() {
    UserService.getPublicContent().then(
      response => {
        this.setState({
          content: response.data
        });
      },
      error => {
        this.setState({
          content:
            (error.response && error.response.data) ||
            error.message ||
            error.toString()
        });
      }
    );
  }

  render() {
    return (
      <Router>
      <div>
      <div className="navbars">
            <ul>
            <li>
              <div classname="link">
                <Link className="link" to={"/search"} >
                 Search
                </Link>
                </div>
              </li>
                
              <li>
                <div classname="link">
                <Link className="link" to={"/delete"} >
                
                Delete
                </Link></div>
              </li>
              
              
             
            </ul>
        </div>
        <div >
            <Switch>
              <Route exact path="/search" component={User} />
              

            </Switch>
        </div>
      </div>
      </Router>
    );
  }
}
